import collage from './images/collage.jpeg';

let type = [collage,collage,collage];
function Component(props){
    let name = props.name;

    let d = collage;
    if(name=="collage")
    {
        d=type[0];
    }else if(name=="scrolling")
    {
        d=type[1];
    }else
    {
        d=type[2];
    }
    return (
        <div className='component'>
            <img src={d}></img>
            <a href="https://google.com">{name}</a>
        </div>
    );
}
export default Component;
